import React from "react";
import { InfoWindow } from "react-google-maps";

const Info = (props) => {
  function click() {
    console.log(props.click);
  }

  return (
    <InfoWindow
      position={{
        lat: props.lat,
        lng: props.lng,
      }}
      onClick={click}
    >
      <div>a</div>
    </InfoWindow>
  );
};

export default Info;
